import React, { Component } from 'react'

export default class AboutUs extends Component {
	render() {
		return (
			<div className="div-container">
				<h1>About Us</h1>
				<div id="group">
					<p>CS 152 Project</p>
					<p>Spring 2024</p>
					<p>Group</p>
					<p>-----</p>
					<ul>
						<li>Do Tran</li>
						<li>Quyen Nguyen</li>
					</ul>
				</div>
			</div>
		)
	}
}
